import { useNavigate } from 'react-router-dom';
import React, { useState, useEffect } from 'react';
import './LoginPage.css';

function LoginPage({ data }) {
  const [fetchedData, setFetchedData] = useState('');  // Changed state variable name
  const navigate = useNavigate();

  useEffect(() => {
    // Define an async function to fetch data
    const fetchData = async () => {
      try {
        const response = await fetch('/home/management/checkout/123');  // Replace with actual project ID
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const result = await response.json();
        setFetchedData(result.message);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();  // Call the async function
  }, []);

  // Function to navigate to the home page
  function goToAboutPage() {
    navigate('/home');
  }

  return (
    <div className="login-container">
      <div className="App">
        <h1>{fetchedData}</h1>  {/* Display the fetched data */}
      </div>
      <div className="login-box">
        <h2>Login to your JESSA Account</h2>
        <div className="login-field">
          <label>Username:</label>
          <input type="text" />
        </div>
        <div className="login-field">
          <label>Password:</label>
          <input type="password" />
        </div>
        <div className="login-actions">
          <button className="login-button">LOG IN</button>
          <button className="new-user-button">NEW USER</button>
        </div>
      </div>
      <button onClick={goToAboutPage}>Go To Home Page</button>
    </div>
  );
}

export default LoginPage;
